import React from "react";
import { Button } from "./Button";
import "./HeroSection.css";
import "../App.css";

function HeroSection() {
  return (
    <div className="hero-container">
      <h1 className="hero-title">Welcome to My Portfolio</h1>
      <p className="hero-description">
        Showcasing my skills and projects in software engineering.
      </p>
      <div className="hero-btns">
        <Button
          className="btns"
          buttonStyle="btn--outline"
          buttonSize="bton--large"
          onClick={() =>
            window.open(
              "https://github.com/jrnolasc/Resume/blob/04b3ea724ca9fe21ec6a3745201b07471499ab56/Julio_Nolasco_Resume.pdf",
              "_blank"
            )
          }
        >
          Resume <i className="fa-solid fa-download" />
        </Button>
      </div>
    </div>
  );
}

export default HeroSection;
